/*Data for the table `dm_about` */

insert  into `dm_about`(`id`,`name`,`content`,`click_nums`,`created_at`,`updated_at`) values (1,'关于我','<h2 style=\"margin: 0px 0px 20px; padding: 0px; font-family: &#39;Architects Daughter&#39;, cursive; font-size: 22px; color: rgb(105, 105, 105); line-height: 22px; white-space: normal; background-color: rgb(255, 255, 255);\">Just about me　</h2><ul style=\"list-style-type: none;\" class=\" list-paddingleft-2\"><li><p></p></li><p style=\"margin-top: 0px; margin-bottom: 20px; padding: 0px;\">小达摩是笔名也是网名，真名就不透露了，作为80后，身上有80后诸多特点：陶醉于自我，愤世嫉俗，算得上妥妥的垮掉的一代。</p><p style=\"margin-top: 0px; margin-bottom: 20px; padding: 0px;\">在学历贬值的年代里，高中没有好好学习，只知道上网看书，那个时候连以后的工作都想好了，立志做个IT从业者，具体做什么却不知道。幸得高考前阵努力一把，勉强考上末流学校，混得大专文凭，好在学校教过一些技能譬如Html、Php、JS、C/C++、SQL，学得广而不专，多而不精，只能算是基础，稀里糊涂大学混了三年，使尽浑身解数拿到英语等级证，但用不着。毕业证有了，却怎么也找不到如意的工作。</p><p style=\"margin-top: 0px; margin-bottom: 20px; padding: 0px;\">毕业后迷茫了一段时间，找到人生第一份工作——软件测试。</p><p style=\"margin-top: 0px; margin-bottom: 20px; padding: 0px;\">小达摩个人博客开通于2017年6月，域名也用本人笔名，博客主要记录自己的心情、笔记，写一些自己精通的教程，搜集好玩的资源，顺其自然，做好内容即可。</p><p style=\"margin-top: 0px; margin-bottom: 20px; padding: 0px;\">希望大家会喜欢我的博客，关于教程有什么不懂的，可以留言或QQ小达摩，我一定尽力解决!</p><p style=\"margin-top: 0px; margin-bottom: 20px; padding: 0px;\"><br/></p></ul><h2 style=\"margin: 0px 0px 20px; padding: 0px; font-family: &#39;Architects Daughter&#39;, cursive; font-size: 22px; color: rgb(105, 105, 105); line-height: 22px; white-space: normal; background-color: rgb(255, 255, 255);\">About My Blog</h2><p style=\"margin-top: 0px; margin-bottom: 20px; padding: 0px; color: rgb(105, 105, 105); font-family: &#39;Helvetica neue&#39;, Helvetica, Tahoma, &#39;lantinghei sc&#39;, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 13px; line-height: 22px; white-space: normal; background-color: rgb(255, 255, 255);\">程 序：小达摩blog 版本信息：V1.0</p><p style=\"margin-top: 0px; margin-bottom: 20px; padding: 0px; color: rgb(105, 105, 105); font-family: &#39;Helvetica neue&#39;, Helvetica, Tahoma, &#39;lantinghei sc&#39;, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 13px; line-height: 22px; white-space: normal; background-color: rgb(255, 255, 255);\">使用框架：CI+jqueryEasyUI</p><p><br/></p>',0,1496814930,1498453547);

