/*Table structure for table `dm_admin_user` */

DROP TABLE IF EXISTS `dm_admin_user`;

CREATE TABLE `dm_admin_user` (
  `user_id` int(11) NOT NULL AUTO_INCREMENT,
  `account` varchar(32) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '账号',
  `name` varchar(32) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '姓名',
  `sex` enum('男','女') COLLATE utf8_bin NOT NULL COMMENT '性别',
  `birthday` date DEFAULT NULL COMMENT '生日',
  `tel` varchar(32) COLLATE utf8_bin DEFAULT '' COMMENT '电话',
  `icon` varchar(255) COLLATE utf8_bin DEFAULT '' COMMENT '头像',
  `height` varchar(10) COLLATE utf8_bin DEFAULT '' COMMENT '身高',
  `weight` varchar(10) COLLATE utf8_bin DEFAULT '' COMMENT '体重',
  `expertise` varchar(128) COLLATE utf8_bin DEFAULT '' COMMENT '专业技能',
  `city_id` int(10) NOT NULL DEFAULT '0' COMMENT '城市id',
  `district_id` int(10) NOT NULL DEFAULT '0' COMMENT '区id',
  `address` varchar(255) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '详细地址',
  `email` varchar(32) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '邮箱',
  `password` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT '密码',
  `salt` varchar(4) COLLATE utf8_bin DEFAULT NULL COMMENT '密码盐',
  `company` smallint(5) NOT NULL DEFAULT '0' COMMENT '公司id',
  `depart` smallint(5) NOT NULL DEFAULT '0' COMMENT '部门id',
  `role_id` int(8) NOT NULL COMMENT '角色id',
  `descinfo` varchar(255) COLLATE utf8_bin DEFAULT '' COMMENT '备注',
  `ustatus` smallint(1) NOT NULL DEFAULT '1' COMMENT '0离职，1在职',
  `is_delete` smallint(1) NOT NULL DEFAULT '0' COMMENT '是否删除,1删除,0未删除',
  `created_at` int(10) unsigned NOT NULL DEFAULT '0',
  `updated_at` int(10) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`user_id`),
  UNIQUE KEY `account` (`account`)
) ENGINE=MyISAM AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='员工表';

