/*Table structure for table `dm_role` */

DROP TABLE IF EXISTS `dm_role`;

CREATE TABLE `dm_role` (
  `role_id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(64) COLLATE utf8_bin NOT NULL,
  `company_id` int(11) NOT NULL DEFAULT '0' COMMENT '公司id',
  `depart_id` int(11) NOT NULL DEFAULT '0' COMMENT '部门id',
  `auth_ids` varchar(2000) COLLATE utf8_bin DEFAULT NULL,
  `auth_ca` varchar(3000) COLLATE utf8_bin DEFAULT NULL,
  `is_delete` smallint(1) NOT NULL DEFAULT '0' COMMENT '是否删除,1删除,0未删除',
  `created_at` int(10) unsigned NOT NULL DEFAULT '0',
  `updated_at` int(10) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`role_id`)
) ENGINE=MyISAM AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='权限表';

